import React from "react";
import { Navbar, Nav } from "react-bootstrap";
import "./myStyles.css";

class HeaderBar extends React.Component {
  render() {
    return (
      <div className="topnav">
        <Navbar
          fixed="top"
          expand="lg"
          variant="dark"
          className="topnav"
        >
          <Navbar.Brand href=""><div style={{padding: "1% 0% 0% 3%"}}>SL TRAFFIC POLICE SYSTEM</div></Navbar.Brand>
        </Navbar>
      </div>
    );
  }
}

export default HeaderBar;
